import React, { useState } from "react";

function Home() {
  const [isRegistered, setIsRegistered] = useState(false);

  const handleClick = (event: { currentTarget: { id: string } }) => {
    if (event.currentTarget.id === "login") {
      setIsRegistered(true);
      console.log(isRegistered);
    } else if (event.currentTarget.id === "register") {
      setIsRegistered(false);

      console.log(isRegistered);
    }
  };

  return (
    <div className="home">
      <div>
        <h1 className="title">Crombiegram</h1>
      </div>
      <img
        src="https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.facebook.com%2Fcrombiedev%2F&psig=AOvVaw1cNzBe7JSfj7YXszIynymR&ust=1671565519787000&source=images&cd=vfe&ved=0CBAQjRxqFwoTCJCv9vm4hvwCFQAAAAAdAAAAABAE"
        alt="logo"
      />
      <div className="home-buttons">
        <button type="submit" id="login" onClick={handleClick}>
          Login
        </button>
        <button type="submit" id="register" onClick={handleClick}>
          Register
        </button>
      </div>
    </div>
  );
}

export default Home;
